import React from "react";
import { Box, Button } from "../UI";
import { extratoLista } from '../../info';
import Items from "../Items";

const Extract = () => {
  return (
    <Box>
      {
        extratoLista.updates.map(({ id, type, from, value, date }) => {
          return (
            <>
              <div key={id}>
                <div>{type}</div>
                <div>{from}</div>
              </div>
              <Items
                key={id}
                type={type}
                from={from}
                value={value}
                date={date}
              />
            </>
          )
        })
      }
      <Button>Ver Mais</Button>
    </Box>
  )
}

export default Extract
